import React, { Fragment } from 'react';

const Header = () => {
    return (
        <Fragment>
            <header>
                <div class="flex items-center justify-between bg-black">
                    <div class="flex items-center justify-center">
                        <div className='p-3'>
                            <img src="https://yt3.googleusercontent.com/HnAnUZS7d8LFtPHaHRtPH9nMoUmrsBBy_FDD-T-YQIycPW55peuWo1NO_rxPIswDbukXYlk7=s176-c-k-c0x00ffffff-no-rj" className='h-[50px] rounded-full mr-5' alt="" /></div>
                        <h2 className='text-white p-2'>Men</h2>
                        <h2 className='text-white p-2'>Women</h2>
                    </div>
                    <div className='bg-white'>
                        <input type="text"/>
                    </div>
                    <div></div>
                </div>
            </header >
        </Fragment >
    );
};

export default Header;
